import React, { useState } from 'react';
import './App.css'; 
const Visibility = () => {

  const [showLargeBox, setShowLargeBox] = useState(false);
  const [showStatusBox, setShowStatusBox] = useState(false);
  const [status, setStatus] = useState('');

  const handleManagerClick = () => {
    setShowLargeBox(prev => !prev); 
    setShowStatusBox(true);          
    setStatus('Not Started');         
  };
  const handleTaskClick = () => {
    setShowStatusBox(true);
  };


  return (
    <div>
        <div className="taskbox">
      <button onClick={handleManagerClick}>Manager</button>
        </div>

        <div className={showLargeBox ? '': 'hidden'}>
        <div className="largebox">
                <div className="empbox">
                    <h3> Employee 1</h3>
                    <ul>
                    <li><button onClick={handleTaskClick}>Task 1</button></li> 
                  <li><button onClick={handleTaskClick}>Task 2</button></li>
                   <li><button onClick={handleTaskClick}>Task 3</button></li>
                   </ul>
                </div>
                <div className="empbox">
                    <h3> Employee 2</h3>
                    <ul>
                    <li><button onClick={handleTaskClick}>Task 1</button></li> 
                  <li><button onClick={handleTaskClick}>Task 2</button></li>
                   <li><button ionClick={handleTaskClick}>Task 3</button></li>
                   </ul>
                </div>
                <div className="empbox">
                    <h3> Employee 3</h3>
                    <ul>
                    <li><button onClick={handleTaskClick}>Task 1</button></li> 
                  <li><button onClick={handleTaskClick}>Task 2</button></li>
                   <li><button onClick={handleTaskClick}>Task 3</button></li>
                   </ul>
                </div>
                </div>
            </div>
      <div className={showStatusBox ? '' : 'hidden'}>
      <div className="statusbox">
        <ul>
                <li><button id="NotStarted">Not Not Started</button></li>
                <li><button id="InProgress">In Progress</button></li> 
                <li><button id="Testing">Testing</button></li>
                <li><button id="Done">Done</button></li>
            </ul>
            <p>Status: {status}</p>
            </div>
      </div>



    </div>


);
}
export default Visibility;
